function setTooltip(){jQuery(".wrapperlikeReshareEvent").each(function(e,t){setTooltipLikeShareDiv(t)})}function setTooltipButton(e,t){if(e){e=jQuery(e);e.tooltip("destroy");if(t){jQuery(e).attr("data-original-title",t);jQuery(e).tooltip()}}}function setTooltipLikeShareDiv(e){if(e){var t=jQuery(e).find(".likeEvent");setTooltipButton(t,getLanguageText("LANG_SOCIAL_LIKE"));var n=jQuery(e).find(".reshareEvent");setTooltipButton(n,getLanguageText("LANG_SOCIAL_RESHARE"))}}jQuery(document).ready(function(){setTooltip()})